import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { SocialSharing } from '@awesome-cordova-plugins/social-sharing/ngx';
import { MenuController } from '@ionic/angular';
import { ApiService } from './auth-api.service';

@Injectable({
  providedIn: 'root'
})
export class GlobalService {
  teamImages: any = [];
  rendomAds: any = [];
  allSportCategoryList: any = [];
  allSportsMatchList: any = [];
  selectedMatchAllData: any = {};
  isDisabled: boolean = null;
  teamImage: any = null;
  crVersion: any;
  category_id: any;

  myappLogo = 'data:image/png;base64,';
  constructor(
    private socialSharing: SocialSharing,
    public manucl: MenuController,
    public http: HttpClient,
    public api: ApiService
  ) {
    this.getCategoryData();
  }

  appShare() {
    this.socialSharing.share(`Hello Friends I'm using Dream Team 11 Prediction App can you download now`,
      '',
      this.myappLogo,
      'https://play.google.com/store/apps/details?id=com.squareapps.dreamteam.dreamapp.original.teamtips'
    ).then((res) => {
      // Success!
    }).catch((error) => {
      // Error!
    })
  }

  rateApp() {
    window.open("https://play.google.com/store/apps/details?id=com.squareapps.dreamteam.dreamapp.original.teamtips", "_system");
  }

  getCategoryData() {
    this.api.post('get_category_list', '').then((res: any) => {
      if (res.ResponseCode == 1) {
        this.allSportCategoryList = res.ResultData;
        if (this.allSportCategoryList.length) {
          this.isDisabled = true;
        }
      }
    })
  }

  getMatchList(apiPath, value) {
    this.allSportsMatchList = [];
    this.isDisabled = true;
    let body = {
      category_id: value
    }
    this.api.post(apiPath, body).then((res: any) => {
      if (res.ResponseCode == 1) {
        this.allSportsMatchList = res.ResultData;
        if (apiPath == 'get_complete_match_list') {
          this.allSportsMatchList = this.shortOrder(this.allSportsMatchList, 'match_end_time')
        }
      }
      this.isDisabled = false;
    }, err => {
      this.isDisabled = false;
    })
  }

  shortOrder(array: any, key) {
    return array.sort(function (a, b) {
      if (a[key] > b[key]) { return -1; }
      if (a[key] < b[key]) { return 1; }
      return 0;
    })
  }

  segmentChanged(event) {
    this.isDisabled = true;
    this.allSportsMatchList = [];
    this.getMatchList('12345', event.target.value);
  }

  toggleMenu() {
    this.manucl.toggle()
  }

}
